RSpec.configure do |rspec|
  # This config option will be enabled by default on RSpec 4,
  # but for reasons of backwards compatibility, you have to
  # set it on RSpec 3.
  #
  # It causes the host group and examples to inherit metadata
  # from the shared context.
  rspec.shared_context_metadata_behavior = :apply_to_host_groups
end

RSpec.shared_context "tree_utils", :shared_context => :metadata do

  def get_tree_hash(tree_id, name, patient_id, pages_array)
    {
      id: tree_id, name: name, patient_id: patient_id,
      pages: pages_array
    }
  end

  def create_tree(tree_id, name, patient_id, card_tag_ids = [])
    # Root page
    target_content = Text.create!(id: SecureRandom.uuid())
    target_card = ArchivedCard.create!(id: SecureRandom.uuid(), label: name, level: 3, card_tag_ids: card_tag_ids, content_id: target_content.id)

    empty_content = Text.create!(id: SecureRandom.uuid())
    empty_card = ArchivedCard.create!(id: SecureRandom.uuid(), label: "", level: 5, card_tag_ids: card_tag_ids, content_id: empty_content.id)

    root_page = ArchivedCardPage.create!(id: "tree_#{name.tr(" ", "_")}_root", name: name)

    PageLayout.create!(page: root_page, card: target_card, x_pos: 0.1, y_pos: 0.2, scale: 1)
    PageLayout.create!(page: root_page, card: empty_card, x_pos: 0.7, y_pos: 0.3, scale: 0.5)

    # Exercise
    tree = CustomTree.create!(id: tree_id, name: name.titleize, root_page: root_page, patient_id: patient_id)
    return tree
  end

  def create_tree_with_pages(tree_id, name, num_pages, patient_id, card_tag_ids = [])
    tree = create_tree(tree_id, name, patient_id, card_tag_ids)
    prev_page = tree.root_page
    (num_pages-1).times do |i|
      target_content = Text.create!(id: SecureRandom.uuid())
      target_card = ArchivedCard.create!(id: SecureRandom.uuid(), label: name, level: 3, card_tag_ids: card_tag_ids, content_id: target_content.id)

      empty_content = Text.create!(id: SecureRandom.uuid())
      empty_card = ArchivedCard.create!(id: SecureRandom.uuid(), label: "", level: 5, card_tag_ids: card_tag_ids, content_id: empty_content.id)

      page = ArchivedCardPage.create!(id: "tree_#{name.tr(" ", "_")}_#{i}", name: "#{name}_#{i}")

      PageLayout.create!(page: page, card: target_card, x_pos: 0.1, y_pos: 0.2, scale: 1)
      PageLayout.create!(page: page, card: empty_card, x_pos: 0.7, y_pos: 0.3, scale: 0.5)

      # Create link with previous page
      page.parent_id = prev_page.id
      page.save!
      prev_page.page_layouts.first.update!(next_page_id: page.id)
      prev_page = page
    end
    return tree
  end

  def create_exercise_tree(tree_id, name, exercise_card_tag_ids = [])
    # Root page
    target_content = Text.create!(id: SecureRandom.uuid())
    target_card = CognitiveCard.create!(id: SecureRandom.uuid(), label: name, level: 3, card_tag_ids: exercise_card_tag_ids, content_id: target_content.id)

    empty_content = Text.create!(id: SecureRandom.uuid())
    empty_card = CognitiveCard.create!(id: SecureRandom.uuid(), label: "", level: 5, card_tag_ids: exercise_card_tag_ids, content_id: empty_content.id)

    root_page = PresetPage.create!(id: "exercise_#{name.tr(" ", "_")}_root", name: name)

    CognitivePageLayout.create!(page: root_page, card: target_card, correct: true, x_pos: 0.1, y_pos: 0.2, scale: 1)
    CognitivePageLayout.create!(page: root_page, card: empty_card, correct: false, x_pos: 0.7, y_pos: 0.3, scale: 0.5)

    # Exercise
    exercise = ExerciseTree.create!(id: tree_id, name: "#{name.titleize}", root_page: root_page, strong_feedback_page: FeedbackPage.strong_random.first)
    return exercise
  end

  def create_exercise_tree_with_pages(tree_id, name, num_pages, card_tag_ids = [])
    tree = create_exercise_tree(tree_id, name, card_tag_ids)
    prev_page = tree.root_page
    (num_pages-1).times do |i|
      target_content = Text.create!(id: SecureRandom.uuid())
      target_card = CognitiveCard.create!(id: SecureRandom.uuid(), label: name, level: 3, card_tag_ids: card_tag_ids, content_id: target_content.id)

      empty_content = Text.create!(id: SecureRandom.uuid())
      empty_card = CognitiveCard.create!(id: SecureRandom.uuid(), label: "", level: 5, card_tag_ids: card_tag_ids, content_id: empty_content.id)

      page = ArchivedCardPage.create!(id: "exercise_#{name.tr(" ", "_")}_#{i}", name: "#{name}_#{i}")

      CognitivePageLayout.create!(page: page, card: target_card, x_pos: 0.1, y_pos: 0.2, scale: 1, correct: true)
      CognitivePageLayout.create!(page: page, card: empty_card, x_pos: 0.7, y_pos: 0.3, scale: 0.5, correct: false)

      # Create link with previous page
      page.parent_id = prev_page.id
      page.save!
      prev_page.page_layouts.first.update!(next_page_id: page.id)
      prev_page = page
    end
    return tree
  end

  def create_exercise_tree_with_card(tree_id, name, card, exercise_card_tag_ids = [])
    # Root page
    root_page = PresetPage.create!(id: "exercise_#{name}_root", name: name)

    CognitivePageLayout.create!(page: root_page, card: card, correct: true, x_pos: 0.1, y_pos: 0.2, scale: 1)

    # Exercise
    exercise = ExerciseTree.create!(id: tree_id, name: "#{name.titleize}", root_page: root_page, strong_feedback_page: FeedbackPage.strong_random.first)
    return exercise
  end

  def create_page( page_id, name, type, patient_id = nil)
    content = Text.create!(id: SecureRandom.uuid())
    card = ArchivedCard.create!(id: SecureRandom.uuid(), label: name, level: 3, card_tag_ids: [], content_id: content.id)

    page = Page.create!(id: page_id, name: name, type: type, patient_id: patient_id)

    PageLayout.create!(page: page, card: card, x_pos: 0.35, y_pos: 0.2, scale: 1)

    return page
  end

  def create_presentation_page( page_id, name)
    # Presentation page
    presentation_page = create_page( page_id, name, "PresentationPage")
    presentation_page.set_cards_not_selectable

    return presentation_page
  end

  def get_page_hash( page_id )
    get_page_hash_with_cards( page_id, [
          {
              id: Card.first.id,
              x_pos: 0.073,
              y_pos: 0.013,
              scale: 1,
          }
      ]
    )
  end

  def get_page_hash_from_existing( page_id )
    page = Page.includes(:page_layouts).find(page_id)
    page_hash = {
      id: page.id,
      name: page.name,
      level: page.depth,
      cards: [],
    }
    page.page_layouts.each do |page_layout|
      page_hash[:cards] << {
        id: page_layout.card_id,
        x_pos: page_layout.x_pos,
        y_pos: page_layout.y_pos,
        scale: page_layout.scale,
        correct: page_layout.correct,
        next_page_id: page_layout.next_page_id,
      }
    end
    return page_hash
  end

  def get_page_with_correct_hash( page_id )
    page_hash = get_page_hash(page_id)
    page_hash[:cards].each do |card|
      card[:correct] = false
    end
    page_hash[:cards][0][:correct] = true
    return page_hash
  end

  def get_page_hash_with_cards( page_id, cards_array, level = 0 )
    {
      id: page_id,
      name: "Custom page #{page_id}",
      level: level,
      page_tags: [],
      cards: cards_array,
      background_color: "black",
    }
  end
  
  def get_page_layout_hash(card_id, correct = nil, next_page_id = nil)
    {
      id: card_id,
      x_pos: 0.073,
      y_pos: 0.013,
      scale: 1,
      correct: correct,
      next_page_id: next_page_id,
    }
  end

  def get_card_hash(card_id, label = "Test Card", level = 3, card_tags = [], content, patient_id)
    {
      id: card_id,
      label: label,
      level: level,
      card_tags: card_tags,
      patient_id: patient_id,
      content: content
    }
  end

  def get_content_image_hash
    {
      type: "GenericImage",
      content: "data:image/png;base64,"
    }
  end

  # Base64 of the picture of a Cat
  def get_cat_image_base64
    "data:image/jpeg;base64,"
  end


end

RSpec.configure do |rspec|
  rspec.include_context "tree_utils", :include_shared => true
end